import logo from './logo.svg';
import React, { Component } from 'react'
import Headers from './Headers'
import Body from './Body'
import './App.css';

class App extends Component {

    state = {
      profil: "visiteur",
    }
    render() {
      const {profil} = this.state
      return (
        <div className="App">
          <Headers profil={profil}/>
          <Body profil={profil}/>
        </div>
      )
    }
  }

export default App;
